import { useEffect, useState } from "react";

function App() {
  const [coins, setCoins] = useState([]);

  useEffect(() => {
    fetch("https://api.coinpaprika.com/v1/tickers");
  }, []);

  return (
    <div>
      <h1>The Coins!</h1>
    </div>
  );
}
export default App;
